import React, {Component} from 'react';
import './PageTwo.css' ;


export default class Albumpage extends Component {

    render()

    {

    return(

    <div className = 'disp'>

        <img className = 'hdr' src = {require('./images/hdr.jpg')} alt = "Nandana in Maize Field"/>

        <p className = 'txt_one'>My Photo Albums</p>

        <div className = 'lne_a'></div>

        <div className = 'cont_a'>
        <figure>
            <img  className = 'img_hvr'         
              src = {require('./images/Album-1/01.jpg')}
              alt = 'Baby Nandana'
            />
            <figcaption className = "cption">Those early days...</figcaption>

          </figure>

        </div>


    </div>



     );
    }




}
